import { Form, FormGroup, FormControl, Button, ControlLabel } from 'react-bootstrap'

import './guestMembers.css'

class GuestMembers extends Component {
    constructor(props) {
        super(props);
        this.handleSubmit = this.handleSubmit.bind(this);
        this.handleInputChange = this.handleInputChange.bind(this);

        this.state = {
            partyCount: '',
            alertVisible: false,
            partyCountEntered: false,
            alertVisibility: STYLES.ALERT
        }
    }

